(function(){var loadHandler=window['sl_{20DC5220-7602-4A25-ABA8-0994F313D7C2}'];loadHandler&&loadHandler(4, '<div id="spr0_5a94175"><div id="spr1_5a94175" class="kern slide"><img id="img3_5a94175" src="data:image/png;base64," width="1280px" height="720px" alt="" style="left:0px;top:0px;"/></div><div id="spr2_5a94175" class="kern slide"><div id="spr3_5a94175" style="left:67.73px;top:364.703px;"><div style="width:0px;"><span id="txt0_5a94175" data-width="245.470703" style="left:9.6px;top:33.918px;">Molar change in enthalpy (</span></div><div style="width:0px;"><span id="txt1_5a94175" class="relpos" style="left:254.767px;top:33.918px;">Δ</span> <span id="txt2_5a94175" class="relpos" style="left:254.76px;top:47.611px;">r</span> <span id="txt3_5a94175" class="relpos" style="left:254.753px;top:33.918px;">H</span></div><div style="width:0px;"><span id="txt4_5a94175" class="relpos" style="left:290.6px;top:47.611px;">m</span> <span id="txt5_5a94175" class="relpos" data-width="404.690735" style="left:290.593px;top:33.918px;">) – change in energy per mole of a substance</span></div><div style="width:0px;"><span id="txt6_5a94175" data-width="273.770813" style="left:9.6px;top:61.118px;">undergoing a specific reaction</span></div><div style="width:0px;"><span id="txt7_5a94175" class="relpos" data-width="371.576172" style="left:9.6px;top:115.518px;">                                                               Δ</span> <span id="txt8_5a94175" class="relpos" style="left:9.593px;top:129.211px;">r</span> <span id="txt9_5a94175" class="relpos" style="left:9.587px;top:115.518px;">H</span> <span id="txt10_5a94175" class="relpos" data-width="24.116535" style="left:9.58px;top:115.518px;"> = </span> <span id="txt11_5a94175" class="relpos" style="left:9.573px;top:115.518px;">n</span> <span id="txt12_5a94175" class="relpos" data-width="20.242838" style="left:9.567px;top:115.518px;"> Δ</span> <span id="txt13_5a94175" class="relpos" style="left:9.56px;top:129.211px;">r</span> <span id="txt14_5a94175" class="relpos" style="left:9.553px;top:115.518px;">H</span> <span id="txt15_5a94175" class="relpos" style="left:9.547px;top:129.211px;">m</span></div></div><div id="spr4_5a94175" style="left:941.717px;top:301.991px;"><div id="spr5_5a94175" style="left:-1116.139px;top:-501.031px;"><img id="img0_5a94175" src="data:image/png;base64," width="1548.392" height="1238.403" alt=""/></div></div><div id="spr6_5a94175" style="left:35.115px;top:-14.196px;"><div style="width:0px;"><span id="txt16_5a94175" data-width="305.302734" style="left:9.6px;top:43.707px;">Heat Transfer and Calorimetry</span></div></div><div id="spr7_5a94175" style="left:35.115px;top:-14.196px;"><div style="width:0px;"><span id="txt17_5a94175" class="nokern relpos" dir="auto" style="left:9.6px;top:78.176px;">•</span> <span id="txt18_5a94175" class="relpos" data-width="161.145828" style="left:31.664px;top:78.387px;">Thermal energy </span> <span id="txt19_5a94175" class="relpos" data-width="192.589188" style="left:31.658px;top:78.387px;">– the kinetic energy (</span> <span id="txt20_5a94175" class="relpos" style="left:31.651px;top:78.387px;">E</span> <span id="txt21_5a94175" class="relpos" style="left:31.644px;top:92.08px;">k</span> <span id="txt22_5a94175" class="relpos" data-width="686.020813" style="left:31.638px;top:78.387px;">) of the entities of a substance.  Thermal energy increases with temperature.</span></div></div><div id="spr8_5a94175" style="left:35.115px;top:-14.196px;"><div style="width:0px;"><span id="txt23_5a94175" data-width="89.050781" style="left:393.6px;top:111.027px;">Q = mcΔt</span></div></div><div id="spr9_5a94175" style="left:35.115px;top:-14.196px;"><div style="width:0px;"><span id="txt24_5a94175" class="nokern relpos" dir="auto" style="left:9.6px;top:143.456px;">•</span> <span id="txt25_5a94175" class="relpos" data-width="128.396484" style="left:31.664px;top:143.667px;">Temperature</span> <span id="txt26_5a94175" class="relpos" data-width="645.723267" style="left:31.658px;top:143.667px;"> – a measure of the average kinetic energy of the entities of a substance</span></div></div><div id="spr10_5a94175" style="left:35.115px;top:-14.196px;"><div style="width:0px;"><span id="txt27_5a94175" class="nokern relpos" dir="auto" style="left:9.6px;top:176.096px;">•</span> <span id="txt28_5a94175" class="relpos" data-width="46.572914" style="left:31.664px;top:176.307px;">Heat</span> <span id="txt29_5a94175" class="relpos" data-width="164.897781" style="left:31.658px;top:176.307px;"> – thermal energy </span> <span id="txt30_5a94175" class="relpos" data-width="98.159500" style="left:31.651px;top:176.307px;">transferred</span> <span id="txt31_5a94175" class="relpos" data-width="244.873047" style="left:31.645px;top:176.307px;"> between systems.  Heat is </span> <span id="txt32_5a94175" class="relpos" data-width="36.519897" style="left:31.638px;top:176.307px;">not</span> <span id="txt33_5a94175" class="relpos" data-width="213.429688" style="left:31.631px;top:176.307px;"> possessed by a system.</span></div></div><div id="spr11_5a94175" style="left:35.115px;top:-14.196px;"><div style="width:0px;"><span id="txt34_5a94175" class="nokern relpos" dir="auto" style="left:9.6px;top:208.736px;">•</span> <span id="txt35_5a94175" class="relpos" data-width="259.991516" style="left:31.664px;top:208.947px;">Chemical potential energy </span> <span id="txt36_5a94175" class="relpos" style="left:31.658px;top:208.947px;">(</span> <span id="txt37_5a94175" class="relpos" style="left:31.651px;top:208.947px;">E</span> <span id="txt38_5a94175" class="relpos" style="left:31.645px;top:222.64px;">p</span> <span id="txt39_5a94175" class="relpos" data-width="13.214844" style="left:31.638px;top:208.947px;">) </span> <span id="txt40_5a94175" class="relpos" data-width="310.316406" style="left:31.631px;top:208.947px;">– energy stored in chemical bonds</span></div></div><div id="spr12_5a94175" style="left:35.115px;top:-14.196px;"><div style="width:0px;"><span id="txt41_5a94175" class="nokern relpos" dir="auto" style="left:9.6px;top:241.376px;">•</span> <span id="txt42_5a94175" class="relpos" data-width="89.449219" style="left:31.664px;top:241.587px;">Enthalpy</span> <span id="txt43_5a94175" class="relpos" data-width="13.214844" style="left:31.658px;top:241.587px;"> (</span> <span id="txt44_5a94175" class="relpos" style="left:31.651px;top:241.587px;">H</span> <span id="txt45_5a94175" class="relpos" data-width="557.037720" style="left:31.645px;top:241.587px;">) – the total kinetic and potential energy in a chemical system</span></div></div><div id="spr13_5a94175" style="left:35.115px;top:-14.196px;"><div style="width:0px;"><span id="txt46_5a94175" class="nokern relpos" dir="auto" style="left:9.6px;top:274.016px;">•</span> <span id="txt47_5a94175" class="relpos" data-width="194.603516" style="left:31.664px;top:274.227px;">Change in enthalpy </span> <span id="txt48_5a94175" class="relpos" data-width="22.124348" style="left:31.658px;top:274.227px;">(Δ</span> <span id="txt49_5a94175" class="relpos" style="left:31.651px;top:287.92px;">r</span> <span id="txt50_5a94175" class="relpos" style="left:31.645px;top:274.227px;">H</span> <span id="txt51_5a94175" class="relpos" data-width="825.064453" style="left:31.638px;top:274.227px;">) – difference in enthalpy (assume the difference in chemical potential energy) between the</span></div><div style="width:0px;"><span id="txt52_5a94175" class="relpos" data-width="219.660797" style="left:39.6px;top:306.867px;">products and reactants.  </span> <span id="txt53_5a94175" class="relpos" data-width="570.429688" style="left:39.593px;top:303.087px;">THE TEMPERATURE OF THE SYSTEM DOES NOT CHANGE</span> <span id="txt54_5a94175" class="relpos" style="left:39.587px;top:306.867px;">!</span></div></div><div id="spr14_5a94175" style="left:377.536px;top:301.991px;"><div style="width:0px;"><span id="txt55_5a94175" class="relpos" style="left:9.6px;top:33.652px;">Δ</span> <span id="txt56_5a94175" class="relpos" style="left:9.593px;top:47.346px;">r</span> <span id="txt57_5a94175" class="relpos" style="left:9.587px;top:33.652px;">H</span> <span id="txt58_5a94175" class="relpos" data-width="24.116535" style="left:9.58px;top:33.652px;"> = </span> <span id="txt59_5a94175" class="relpos" style="left:9.573px;top:33.652px;">H</span> <span id="txt60_5a94175" class="relpos" data-width="55.818142" style="left:9.567px;top:47.346px;">products </span> <span id="txt61_5a94175" class="relpos" data-width="17.000000" style="left:9.56px;top:33.652px;">– </span> <span id="txt62_5a94175" class="relpos" style="left:9.553px;top:33.652px;">H</span> <span id="txt63_5a94175" class="relpos" data-width="53.693142" style="left:9.547px;top:47.346px;">reactants</span></div></div><div id="svg0_5a94175" style="left:1140px;top:677.524px;"><svg width="134" height="39" viewBox="0 0 134 39"><path fill="#e2f0d9" d="M0,0 h134 v38.775 h-134 Z"/></svg></div><div id="spr15_5a94175" style="left:1140px;top:677.524px;"><div style="width:0px;"><span id="txt64_5a94175" class="relpos" style="left:10.137px;top:2.267px;">A</span> <span id="txt65_5a94175" class="relpos" style="left:10.13px;top:2.267px;"> </span> <span id="txt66_5a94175" class="relpos" data-width="77.484375" style="left:10.123px;top:2.267px;">– Page </span> <span id="txt67_5a94175" class="relpos" style="left:10.117px;top:2.267px;">1</span></div></div><div id="spr16_5a94175" aria-label="Text, logo  Description automatically generated" role="group" style="left:997.465px;top:-7.62px;"><div id="spr17_5a94175"><img id="img1_5a94175" src="data:image/png;base64," width="294" height="82.5" alt="" style="left:0.109px;top:0.071px;"/></div></div><div id="spr18_5a94175" style="left:1218.321px;top:51.158px;"><div id="svg1_5a94175" style="left:5.031px;top:4.251px;"><svg width="47" height="28" viewBox="0 0 47 28"><path fill="#c00000" d="M0,0 h46.08 v27.429 h-46.08 Z"/></svg></div><div id="svg2_5a94175" style="left:0px;top:0px;"><svg width="65" height="28" viewBox="0 0 65 28"><path fill="none" d="M0,0 h64.174 v27.433 h-64.174 Z"/></svg></div><div id="spr19_5a94175"><div style="width:0px;"><span id="txt68_5a94175" data-width="42.155083" style="left:9.598px;top:2.268px;">END</span></div></div></div><div id="svg3_5a94175" style="left:569.514px;top:116.58px;"><svg width="686" height="93" viewBox="0 0 686 93"><path fill="#ebffeb" d="M0,0 h685.071 v92.091 h-685.071 Z"/></svg></div><div id="spr20_5a94175" style="left:569.514px;top:116.58px;"><div style="width:0px;"><span id="txt69_5a94175" class="relpos" data-width="204.940750" style="left:9.6px;top:1.933px;">Thermal energy is the </span> <span id="txt70_5a94175" class="relpos" data-width="184.550491" style="left:9.593px;top:1.933px;">total kinetic energy</span> <span id="txt71_5a94175" class="relpos" data-width="282.071594" style="left:9.587px;top:1.933px;"> of all particles in a substance -</span></div><div style="width:0px;"><span id="txt72_5a94175" data-width="405.675781" style="left:9.6px;top:29.133px;">the energy of motion at the molecular level.</span></div><div style="width:0px;"><span id="txt73_5a94175" data-width="668.998657" style="left:9.6px;top:56.333px;">As particles move faster, temperature rises, and so does thermal energy.</span></div></div><div id="svg4_5a94175" style="left:565.336px;top:214.864px;"><svg width="686" height="93" viewBox="0 0 686 93"><path fill="#ebffeb" d="M0,0 h685.071 v92.091 h-685.071 Z"/></svg></div><div id="spr21_5a94175" style="left:565.336px;top:214.864px;"><div style="width:0px;"><span id="txt74_5a94175" class="relpos" data-width="127.090492" style="left:9.6px;top:1.933px;">The equation </span> <span id="txt75_5a94175" class="relpos" data-width="85.962891" style="left:9.593px;top:1.933px;">Q = mcΔt</span> <span id="txt76_5a94175" class="relpos" data-width="448.740234" style="left:9.587px;top:1.933px;"> shows how much heat energy (Q) is transferred:</span></div><div style="width:0px;"><span id="txt77_5a94175" class="relpos" data-width="166.989578" style="left:9.6px;top:29.133px;">it depends on the </span> <span id="txt78_5a94175" class="relpos" data-width="91.581741" style="left:9.593px;top:29.133px;">mass (m)</span> <span id="txt79_5a94175" class="relpos" data-width="195.356110" style="left:9.587px;top:29.133px;"> of the substance, its </span> <span id="txt80_5a94175" class="relpos" data-width="203.764038" style="left:9.58px;top:29.133px;">specific heat capacity</span></div><div style="width:0px;"><span id="txt81_5a94175" class="relpos" data-width="30.731487" style="left:9.6px;top:56.333px;">(c)</span> <span id="txt82_5a94175" class="relpos" data-width="86.483070" style="left:9.593px;top:56.333px;">, and the </span> <span id="txt83_5a94175" class="relpos" data-width="256.877960" style="left:9.587px;top:56.333px;">change in temperature (Δt)</span> <span id="txt84_5a94175" class="relpos" style="left:9.58px;top:56.333px;">.</span></div></div><div id="svg5_5a94175" style="left:264.98px;top:169.739px;"><svg width="623" height="93" viewBox="0 0 623 93"><path fill="#ebffeb" d="M0,0 h622.152 v92.091 h-622.152 Z"/></svg></div><div id="spr22_5a94175" style="left:264.98px;top:169.739px;"><div style="width:0px;"><span id="txt85_5a94175" class="relpos" data-width="256.272766" style="left:9.6px;top:1.933px;">Temperature measures the </span> <span id="txt86_5a94175" class="relpos" data-width="82.041382" style="left:9.593px;top:1.933px;">average</span> <span id="txt87_5a94175" class="relpos" data-width="247.783844" style="left:9.587px;top:1.933px;"> kinetic energy of particles,</span></div><div style="width:0px;"><span id="txt88_5a94175" data-width="527.863281" style="left:9.6px;top:29.133px;">meaning two objects of different sizes can have the same</span></div><div style="width:0px;"><span id="txt89_5a94175" data-width="456.731110" style="left:9.6px;top:56.333px;">temperature even if one holds more total energy.</span></div></div><div id="svg6_5a94175" style="left:264.98px;top:266.501px;"><svg width="623" height="65" viewBox="0 0 623 65"><path fill="#ebffeb" d="M0,0 h622.152 v64.625 h-622.152 Z"/></svg></div><div id="spr23_5a94175" style="left:264.98px;top:266.501px;"><div style="width:0px;"><span id="txt90_5a94175" data-width="570.064453" style="left:9.6px;top:1.933px;">Unlike heat, temperature does not depend on mass - it simply</span></div><div style="width:0px;"><span id="txt91_5a94175" data-width="473.122375" style="left:9.6px;top:29.133px;">reflects how energetic the particles are on average.</span></div></div><div id="svg7_5a94175" style="left:157.485px;top:198.157px;"><svg width="623" height="93" viewBox="0 0 623 93"><path fill="#ebffeb" d="M0,0 h622.152 v92.091 h-622.152 Z"/></svg></div><div id="spr24_5a94175" style="left:157.485px;top:198.157px;"><div style="width:0px;"><span id="txt92_5a94175" class="relpos" data-width="55.847656" style="left:9.6px;top:1.933px;">Heat (</span> <span id="txt93_5a94175" class="relpos" style="left:9.593px;top:1.933px;">Q</span> <span id="txt94_5a94175" class="relpos" data-width="67.092445" style="left:9.587px;top:1.933px;">) is the </span> <span id="txt95_5a94175" class="relpos" data-width="178.795288" style="left:9.58px;top:1.933px;">energy transferred</span> <span id="txt96_5a94175" class="relpos" data-width="246.400391" style="left:9.573px;top:1.933px;"> between systems due to a</span></div><div style="width:0px;"><span id="txt97_5a94175" data-width="222.626953" style="left:9.6px;top:29.133px;">temperature difference.</span></div><div style="width:0px;"><span id="txt98_5a94175" class="relpos" data-width="37.619141" style="left:9.6px;top:56.333px;">It is </span> <span id="txt99_5a94175" class="relpos" data-width="98.048828" style="left:9.593px;top:56.333px;">not stored</span> <span id="txt100_5a94175" class="relpos" data-width="415.016907" style="left:9.587px;top:56.333px;"> - rather, it flows until equilibrium is reached.</span></div></div><div id="svg8_5a94175" style="left:157.485px;top:294.919px;"><svg width="623" height="62" viewBox="0 0 623 62"><path fill="#ebffeb" d="M0,0 h622.152 v61.394 h-622.152 Z"/></svg></div><div id="spr25_5a94175" style="left:157.485px;top:294.919px;"><div style="width:0px;"><span id="txt101_5a94175" data-width="579.916687" style="left:9.6px;top:2.101px;">When heat is added, particle motion increases; when it is released,</span></div><div style="width:0px;"><span id="txt102_5a94175" data-width="513.083374" style="left:9.6px;top:27.701px;">motion slows down, changing the system’s internal energy.</span></div></div><div id="svg9_5a94175" style="left:197.485px;top:239.962px;"><svg width="818" height="38" viewBox="0 0 818 38"><path fill="#ebffeb" d="M0,0 h817.536 v37.159 h-817.536 Z"/></svg></div><div id="spr26_5a94175" style="left:197.485px;top:239.962px;"><div style="width:0px;"><span id="txt103_5a94175" class="relpos" data-width="253.262360" style="left:9.6px;top:1.933px;">Chemical potential energy (</span> <span id="txt104_5a94175" class="relpos" data-width="19.434895" style="left:9.593px;top:1.933px;">Eₚ</span> <span id="txt105_5a94175" class="relpos" data-width="67.092445" style="left:9.587px;top:1.933px;">) is the </span> <span id="txt106_5a94175" class="relpos" data-width="302.808929" style="left:9.58px;top:1.933px;">energy stored in chemical bonds</span> <span id="txt107_5a94175" class="relpos" data-width="154.792969" style="left:9.573px;top:1.933px;"> between atoms.</span></div></div><div id="svg10_5a94175" style="left:197.485px;top:279.737px;"><svg width="653" height="120" viewBox="0 0 653 120"><path fill="#ebffeb" d="M0,0 h652.477 v119.556 h-652.477 Z"/></svg></div><div id="spr27_5a94175" style="left:197.485px;top:279.737px;"><div style="width:0px;"><span id="txt108_5a94175" data-width="619.348938" style="left:9.6px;top:1.933px;">During a reaction, bonds breaking require energy input, while bond</span></div><div style="width:0px;"><span id="txt109_5a94175" data-width="247.186188" style="left:9.6px;top:29.133px;">formation releases energy.</span></div><div style="width:0px;"><span id="txt110_5a94175" data-width="591.746094" style="left:9.6px;top:56.333px;">The balance between these two determines whether the overall</span></div><div style="width:0px;"><span id="txt111_5a94175" data-width="305.856110" style="left:9.6px;top:83.533px;">process absorbs or releases heat.</span></div></div><div id="svg11_5a94175" style="left:237.485px;top:266.406px;"><svg width="623" height="65" viewBox="0 0 623 65"><path fill="#ebffeb" d="M0,0 h622.152 v64.625 h-622.152 Z"/></svg></div><div id="spr28_5a94175" style="left:237.485px;top:266.406px;"><div style="width:0px;"><span id="txt112_5a94175" class="relpos" data-width="92.703125" style="left:9.6px;top:1.933px;">Enthalpy (</span> <span id="txt113_5a94175" class="relpos" style="left:9.593px;top:1.933px;">H</span> <span id="txt114_5a94175" class="relpos" data-width="151.804688" style="left:9.587px;top:1.933px;">) represents the </span> <span id="txt115_5a94175" class="relpos" data-width="195.894897" style="left:9.58px;top:1.933px;">total internal energy</span> <span id="txt116_5a94175" class="relpos" data-width="126.824867" style="left:9.573px;top:1.933px;"> of a chemical</span></div><div style="width:0px;"><span id="txt117_5a94175" data-width="571.691406" style="left:9.6px;top:29.133px;">system — the sum of its kinetic and potential (bond) energies.</span></div></div><div id="svg12_5a94175" style="left:237.485px;top:342.205px;"><svg width="637" height="62" viewBox="0 0 637 62"><path fill="#ebffeb" d="M0,0 h636.737 v61.394 h-636.737 Z"/></svg></div><div id="spr29_5a94175" style="left:237.485px;top:342.205px;"><div style="width:0px;"><span id="txt118_5a94175" data-width="542.364624" style="left:9.6px;top:2.101px;">Because it includes both motion and stored energy, changes in</span></div><div style="width:0px;"><span id="txt119_5a94175" data-width="614.802124" style="left:9.6px;top:27.701px;">enthalpy reflect how much total energy is gained or lost by the system.</span></div></div><div id="svg13_5a94175" style="left:250.654px;top:394.082px;"><svg width="623" height="93" viewBox="0 0 623 93"><path fill="#ebffeb" d="M0,0 h622.152 v92.723 h-622.152 Z"/></svg></div><div id="spr30_5a94175" style="left:260.25px;top:405px;"><img id="img2_5a94175" src="data:image/png;base64," width="573" height="75.75" alt="The change in enthalpy (ΔH) shows the energy difference between products and reactants:\
Δ𝐻= 𝐻 𝑝𝑟𝑜𝑑𝑢𝑐𝑡𝑠 − 𝐻 𝑟𝑒𝑎𝑐𝑡𝑎𝑛𝑡𝑠 "/></div><div id="svg14_5a94175" style="left:251.145px;top:495.612px;"><svg width="637" height="139" viewBox="0 0 637 139"><path fill="#ebffeb" d="M0,0 h636.737 v138.944 h-636.737 Z"/></svg></div><div id="spr31_5a94175" style="left:251.145px;top:495.612px;"><div style="width:0px;"><span id="txt120_5a94175" class="relpos" data-width="17.166668" style="left:9.6px;top:2.101px;">A </span> <span id="txt121_5a94175" class="relpos" data-width="106.906250" style="left:9.593px;top:2.101px;">negative ΔH</span> <span id="txt122_5a94175" class="relpos" data-width="195.541672" style="left:9.587px;top:2.101px;"> means the reaction is </span> <span id="txt123_5a94175" class="relpos" data-width="103.746674" style="left:9.58px;top:2.101px;">exothermic</span> <span id="txt124_5a94175" class="relpos" data-width="172.854172" style="left:9.573px;top:2.101px;"> (energy released to</span></div><div style="width:0px;"><span id="txt125_5a94175" class="relpos" data-width="197.135422" style="left:9.6px;top:27.701px;">surroundings), while a </span> <span id="txt126_5a94175" class="relpos" data-width="100.739586" style="left:9.593px;top:27.701px;">positive ΔH</span> <span id="txt127_5a94175" class="relpos" data-width="97.604172" style="left:9.587px;top:27.701px;"> means it’s </span> <span id="txt128_5a94175" class="relpos" data-width="116.444588" style="left:9.58px;top:27.701px;">endothermic</span> <span id="txt129_5a94175" class="relpos" data-width="70.864586" style="left:9.573px;top:27.701px;"> (energy</span></div><div style="width:0px;"><span id="txt130_5a94175" data-width="259.020844" style="left:9.6px;top:53.301px;">absorbed from surroundings).</span></div><div style="width:0px;"><span id="txt131_5a94175" data-width="542.583374" style="left:9.6px;top:78.901px;">This equation assumes the temperature of the system remains</span></div><div style="width:0px;"><span id="txt132_5a94175" data-width="252.156250" style="left:9.6px;top:104.501px;">constant during the reaction.</span></div></div><div id="svg15_5a94175" style="left:160.203px;top:516.184px;"><svg width="623" height="62" viewBox="0 0 623 62"><path fill="#ebffeb" d="M0,0 h622.152 v61.394 h-622.152 Z"/></svg></div><div id="spr32_5a94175" style="left:160.203px;top:516.184px;"><div style="width:0px;"><span id="txt133_5a94175" class="relpos" data-width="144.312500" style="left:9.6px;top:2.101px;">Molar enthalpy (</span> <span id="txt134_5a94175" class="relpos" data-width="37.572918" style="left:9.593px;top:2.101px;">ΔHₘ</span> <span id="txt135_5a94175" class="relpos" data-width="134.666672" style="left:9.587px;top:2.101px;">) expresses the </span> <span id="txt136_5a94175" class="relpos" data-width="215.059174" style="left:9.58px;top:2.101px;">energy change per mole</span> <span id="txt137_5a94175" class="relpos" data-width="37.625000" style="left:9.573px;top:2.101px;"> of a</span></div><div style="width:0px;"><span id="txt138_5a94175" data-width="357.625000" style="left:9.6px;top:27.701px;">substance undergoing a specific reaction.</span></div></div><div id="svg16_5a94175" style="left:160.203px;top:585.394px;"><svg width="637" height="88" viewBox="0 0 637 88"><path fill="#ebffeb" d="M0,0 h636.737 v87.244 h-636.737 Z"/></svg></div><div id="spr33_5a94175" style="left:160.203px;top:585.394px;"><div style="width:0px;"><span id="txt139_5a94175" class="relpos" data-width="222.906250" style="left:9.6px;top:2.101px;">Different subscripts (e.g., </span> <span id="txt140_5a94175" class="relpos" style="left:9.593px;top:2.101px;">c</span> <span id="txt141_5a94175" class="relpos" data-width="10.145834" style="left:9.587px;top:2.101px;">, </span> <span id="txt142_5a94175" class="relpos" style="left:9.58px;top:2.101px;">f</span> <span id="txt143_5a94175" class="relpos" data-width="10.145834" style="left:9.573px;top:2.101px;">, </span> <span id="txt144_5a94175" class="relpos" data-width="31.257088" style="left:9.567px;top:2.101px;">sol</span> <span id="txt145_5a94175" class="relpos" data-width="224.083344" style="left:9.56px;top:2.101px;">) specify reaction types —</span></div><div style="width:0px;"><span id="txt146_5a94175" data-width="598.822937" style="left:9.6px;top:27.701px;">combustion, formation, or solution — allowing comparison of energy</span></div><div style="width:0px;"><span id="txt147_5a94175" data-width="328.489594" style="left:9.6px;top:53.301px;">changes between different processes.</span></div></div></div></div>', '{"s":[]}');})();